package com.webpos.entity;import java.io.Serializable;import java.util.Date;//商品表public class Goodsdeal implements Serializable {	private static final long serialVersionUID = 1L;	private Long id;	private String goodsname;//商品名	private Date ctime;	private Long userid;	private String status;	private String name;	private String phone;	private String address;	private Long detailid;		public Long getDetailid() {		return detailid;	}	public void setDetailid(Long detailid) {		this.detailid = detailid;	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getGoodsname() {		return goodsname;	}	public void setGoodsname(String goodsname) {		this.goodsname = goodsname;	}	public Date getCtime() {		return ctime;	}	public void setCtime(Date ctime) {		this.ctime = ctime;	}	public Long getUserid() {		return userid;	}	public void setUserid(Long userid) {		this.userid = userid;	}	public String getStatus() {		return status;	}	public void setStatus(String status) {		this.status = status;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getPhone() {		return phone;	}	public void setPhone(String phone) {		this.phone = phone;	}	public String getAddress() {		return address;	}	public void setAddress(String address) {		this.address = address;	}}